import React from "react";
import State from "./State";
import GasZTRPrice from "./GasZTRPrice";
import DaysMowedPerWeek from "./DaysMowedPerWeek";
import NumberNGBRUnits from "./NumberNGBRUnits";
import MowingHours from "./MowingHours";
import LengthMowingSeason from "./LengthMowingSeason";

const Inputs = ({
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
  whichStep,
  setWhichStep,
}) => {
  return (
    <div className={`main container-inputs ${whichStep === 8 && "floating"}`}>
      <ul className="inputs" id="inputs">
        <li className="column">
          <State
            {...{
              customerInputs,
              setCustomerInputs,
              setPADDRegion,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className="column">
          <GasZTRPrice
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className="column">
          <DaysMowedPerWeek
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className="column">
          <NumberNGBRUnits
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className="column">
          <MowingHours
            {...{
              customerInputs,
              setCustomerInputs,
              //buttonClick,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className="column">
          <LengthMowingSeason
            {...{
              customerInputs,
              setCustomerInputs,
              //  handleClick,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
      </ul>
    </div>
  );
};

export default Inputs;
